import React from 'react';

class SearchInput extends React.Component{
    render(){
        return(
            <div className='ui segment'>
                <form className='ui form'>
                    <div className='field'>
                        <div className='ui massive icon input'></div>
                    </div>
                    <input type="text"></input>
                </form>
            </div>
        )
    }
}
export default SearchInput;
